import React from 'react';
import todoListContainer from '../containers/todosList.container';
import { connect } from 'react-redux';

const TodoList = (props) => {

    const table = props.todoList.map(elem => (
            <tr>
                <td>{elem.todoDescription}</td>
                <td>{elem.todoResponsible}</td>
                <td>{elem.todoPriority}</td>
                <td>{elem.todoCompleted}</td>
            </tr>
    ));

    return (
        <div className='container'>
            <h3 style={{marginBottom: 20}}>Todos list</h3>
            <table className='table table-hover'>
                <thead>
                    <tr>
                        <th>Description</th>
                        <th>Responsible</th>
                        <th>Priority</th>
                        <th>Completed</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {table}
                </tbody>
            </table>
        </div>
    )
}
export default connect(todoListContainer.mapStateToProps)(TodoList);
